import { combineReducers } from 'redux';
import movieReducer from './movieReducer.js';
import postMovieModalReducer from './postMovieModalReducer.js';
import sideDrawerReducer from './sideDrawerReducer.js';
import yPosReducer from './yPosReducer.js';
import marqueeRenderReducer from './marqueeRenderReducer.js';

export default combineReducers({
 movieReducer,
 postMovieModalReducer,
 sideDrawerReducer,
 yPosReducer,
 marqueeRenderReducer
});
